import React from 'react';
import './addPageComponent.scss'
import { func } from 'prop-types';
import  close  from './png/close.png'


const propTypes = {
	onClickHandler: func,
	CloseClick: func,
}
// eslint-disable-next-line react/prop-types
const AddPageComponent = ({
	onClickHandler,
	CloseClick,
	SaveClick,
}) => {
	return (
		<>
		<div className='nav-panel'>
			<button
			type='button'
			className='close-btn' 
			onClick={CloseClick}>
			<img className='close' src={close}/>
			</button>
			<p className='nav-txt'>Add an expense</p>
			<button
			type='button'
			className='save-btn' 
			onClick={SaveClick}>
			<p className='nav-txt save'>Save</p>
			</button>
		</div>
			<header>
				<div className=''>
					<p>With "you" and: All of Daun Hata </p>
				</div>
			</header>
			<section>
				<div className='item-add'>
					<button
					type='button' onClick={onClickHandler}>
						Add Item
					</button>
				</div>
			</section>
		</>
	);
};

AddPageComponent.propTypes = propTypes;
export default AddPageComponent;
